package com.xworks.Inheritance.external;

public class Transport {
    public void move() {
        System.out.println("Transport is moving");
    }

    public void fuel() {
        System.out.println("Transport is refueling");
    }

    public void stop() {
        System.out.println("Transport is stopping");
    }

    public void capacity() {
        System.out.println("Transport has capacity");
    }

    public void service() {
        System.out.println("Transport needs service");
    }
}
